import React from "react";

export default function FormattedDate(props) {
  let days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];
  let day = days(props.date.getDays());
  let hours = props.date.getHours();
  let minutes = props.date.getMinuts();

  return (
    <div>
      {day} {hours} {minutes} hs
    </div>
  );
}
